import React from "react";

function Upperbanner() {
  return (
    <div>
      <div
        style={{ backgroundColor: "#263F53", height: "50px" }}
        className="d-flex align-items-baseline justify-content-evenly text-white"
      >
        <p className="pt-4">100% Digital Transformation of Hostel</p>
        <p>Transforming Hostel Management, One Innovation at a Time</p>
        <p>Experience the Future of Hostel Management</p>
      </div>
    </div>
  );
}

export default Upperbanner;
